  "api/javascript/event_emitter-cursor/": {
    "body": "cursor.addListener(event, listener)cursor.on(event, listener)cursor.once(event, listener)cursor.removeListener(event, listener)cursor.removeAllListeners([event])cursor.setMaxListeners(n)cursor.listeners(event)cursor.emit(event, [arg1], [arg2], [...])", 
    "description": "<p>Cursors and feeds implement the same interface as <a href=\"http://nodejs.org/api/events.html#events_class_events_eventemitter\">EventEmitter</a>.</p>\n<p>There are a few things to know about this interface:</p>\n<ul>\n<li>Two events can be emitted, <code>data</code> and <code>error</code>.</li>\n<li>Once you start using the EventEmitter interface, the other commands like <code>next</code>,\n<code>toArray</code>, <code>each</code> will not be available anymore.</li>\n<li>The first time you call one of the EventEmitter's methods, the cursor or feed will\nemit data just after the I/O events callbacks and before <code>setTimeout</code> and <code>setInterval</code>\ncallbacks.</li>\n</ul>", 
    "example": "<p><strong>Example:</strong> Broadcast all messages with <a href=\"http://socket.io\">socket.io</a>.</p>\n<pre><code>r.table(\"messages\").orderBy({index: \"date\"}).run(conn, function(err, cursor) {\n    if (err) {\n        // Handle error\n        return\n    }\n\n    cursor.on(\"error\", function(error) {\n        // Handle error\n    })\n    cursor.on(\"data\", function(message) {\n        socket.broadcast.emit(\"message\", message)\n    })\n});\n</code></pre>", 
    "io": [
      [
        "cursor", 
        "undefined"
      ]
    ], 
    "name": "EventEmitter methods", 
    "url": "event_emitter-cursor"
  }, 
  "api/javascript/event_emitter/": {
    "body": "connection.addListener(event, listener)connection.on(event, listener)connection.once(event, listener)connection.removeListener(event, listener)connection.removeAllListeners([event])connection.setMaxListeners(n)connection.listeners(event)connection.emit(event, [arg1], [arg2], [...])", 
    "description": "<p>The connection object supports the event emitter interface so you can listen for\nchanges in connection state.</p>", 
    "example": "<p><strong>Example:</strong> Monitor connection state with events 'connect', 'close', and 'error'.</p>\n<pre><code>r.connect({}, function(err, conn) {\n    if (err) throw err;\n\n    conn.addListener('error', function(e) {\n        processNetworkError(e);\n    });\n\n    conn.addListener('close', function() {\n        cleanup();\n    });\n\n    runQueries(conn);\n});\n</code></pre>", 
    "io": [
      [
        "connection", 
        "undefined"
      ]
    ], 
    "name": "EventEmitter methods", 
    "url": "event_emitter"
  }, 
